import Sidebar from "./sidebar";
import profile from "../assests/user.png";
// import { Link } from "react-router-dom"
import { NavLink } from "react-router-dom";
import SearchBar from "./SearchBar";
// import Home from "./Home";
export default function Navbar() {
    return (
        <div className="navbar flex justify-between p-[20px] bg-[purple]">

            <div className="logo flex justify-between sm:w-[auto]">
                <Sidebar />
                <h1>Logo</h1>

            </div>
            <div>
                <SearchBar />
            </div>
            <nav className="elements hidden sm:block">

                <ul className="flex gap-[30px] text-white items-center">
                    <li className="max-[1400px]:block"><button><img src={searchicon} alt="search" /></button></li>
                    <li><NavLink className={({isActive}) => `hover:cursor-pointer ${isActive ? "text-blue-400 font-bold" : "text-white"}`} to="/">
                        Home
                    </NavLink></li>
                    {/* <Link to="/" className= "hover:cursor-pointer">Home</Link> */}
                    <li><NavLink to="/CheckEligibility" className={({isActive}) => `hover:cursor-pointer ${isActive ? "text-blue-400 font-bold" : "text-white"}`}>Check Eligibility</NavLink></li>
                    <li><NavLink to="/Benefits" className={({isActive}) => `hover:cursor-pointer ${isActive ? "text-blue-400 font-bold" : "text-white"}`}>Benefits</NavLink></li>
                    <li><NavLink to="/InterpretLaw" className={({isActive}) => `hover:cursor-pointer ${isActive ?"text-blue-400 font-bold" : "text-white"}`}>Interpretation of Law</NavLink></li>
                    <li><NavLink to="/MyApplications" className={({isActive}) => `hover:cursor-pointer ${isActive ? "text-blue-400 font-bold" : "text-white"}`}>My Applications</NavLink></li>
                    <li><NavLink to="/Profile" className={({isActive}) => `hover:cursor-pointer ${isActive ? "text-blue-400 font-bold" : "text-white"}`}><img className="w-[24px]" src={profile} alt="profile" /></NavLink></li>
                </ul>
            </nav>
        </div>
    );
}
